import { useCallback } from "react";
import Particles from "react-tsparticles";
import { loadFull } from "tsparticles";

function Particle() {
  const particlesInit = useCallback(async engine => {
    console.log(engine);
    // you can initiate the tsParticles instance (engine) here, adding custom shapes or presets
    // this loads the tsparticles package bundle, it's the easiest method for getting everything ready
    // starting from v2 you can add only the features you need reducing the bundle size
    await loadFull(engine);
}, []);

const particlesLoaded = useCallback(async container => {
    await console.log(container);
}, []);
  return (
    <Particles
    id="tsparticles"
    init={particlesInit}
    loaded={particlesLoaded}
    options={{
      "fullScreen": {
          "enable": true,
          "zIndex": 1
      },
      "fpsLimit": 120,
      "emitters": {
          "direction": "top",
          "size": {
              "width": 100,
              "height": 0
          },
          "position": {
              "x": 50,
              "y": 100
          },
          "rate": {
              "delay": 0.1,
              "quantity": 2
          }
      },
      "particles": {
          "number": {
              "value": 0,
              "density": {
                  "enable": true
              }
          },
          "color": {
              "value": "#ffffff"
          },
          "shape": {
              "type": "circle"
          },
          "opacity": {
              "value": 1,
              "random": false,
              "anim": {
                  "enable": false,
                  "speed": 3,
                  "opacity_min": 0.1,
                  "sync": false
              }
          },
          "size": {
              "value": 20,
              "random": false,
              "anim": {
                  "enable": true,
                  "speed": 5,
                  "size_min": 0.1,
                  "sync": true,
                  "startValue": "min",
                  "destroy": "max"
              }
          },
          "line_linked": {
              "enable": false,
              "distance": 150,
              "color": "#ffffff",
              "opacity": 0.4,
              "width": 1
          },
          "move": {
              "enable": true,
              "speed": 5,
              "direction": "none",
              "random": false,
              "straight": false,
              "out_mode": "destroy",
              "attract": {
                  "enable": false,
                  "rotateX": 600,
                  "rotateY": 1200
              }
          }
      },
      "interactivity": {
          "events": {
              "onhover": {
                  "enable": false,
                  "mode": "repulse"
              },
              "onclick": {
                  "enable": false,
                  "mode": "push"
              },
              "resize": true
          },
          "modes": {
              "grab": {
                  "distance": 400,
                  "line_linked": {
                      "opacity": 1
                  }
              },
              "bubble": {
                  "distance": 400,
                  "size": 40,
                  "duration": 2,
                  "opacity": 0.8,
                  "speed": 3
              },
              "repulse": {
                  "distance": 200
              },
              "push": {
                  "particles_nb": 4
              },
              "remove": {
                  "particles_nb": 2
              }
          }
      },
      "retina_detect": true,
      "background": {
          "color": "#0d47a1",
          "image": "",
          "position": "50% 50%",
          "repeat": "no-repeat",
          "size": "cover"
      }
  }}
/>
  )
}

export default Particle
